- input: "TEXT\x1CC00176214\x1C.TEXT\x1C\x1CF3XN\x1CPursuant to an internal review,
    the beginning cash balance for this reporting period is $35,912.48 greater than
    the ending cash balance on the committee's prior monthly report.   This increase
    is due to the following factors: (1)The 12/31/05 ending cash balance was reported
    as $105,786.86, whereas the actual cash balance was $93,946.70, an  overstatement
    \ of $11,840.16.  The committee has not been able to determine the source of this
    discrepancy. (2)Total receipts for the period 1/1/06 through 7/31/09 were understated
    by $48,209.54.  $44,388.57 of this total were received between 1/1/06 and 3/31/07,
    and $1,257.82 were received between 4/1/07 and 12/31/08.  The date of receipt
    for $2,563.15 could not be determined.  Receipts have been reported accurately
    from 1/1/09 to the present.  (3)Total disbursements for the period 1/1/06 through
    7/31/09 were understated by $456.90.  This was primarily due to errors in reporting
    operating expenses and to transactions that were reported as memo entries when
    they should have been reported as cash disbursements. The sum of these amounts
    equals $35,912.48. See the 10/15/09 Form 99 for additional information.\n"
